      <div className='background-image'
        style={{
          backgroundImage: `ur(${imageUrl})`
        }}
      />

      <div className='content'>
        <h1 className='title'>{title}</h1>
        <span className='subtitle'>check it out</span>
      </div>

        {/* <img className='image' src={imageUrl}/>

        <h1 className='title'>{title}</h1>
        <span className='subtitle'>Check it out</span> */}

    </div>
  )
}

